from collections import defaultdict

def solve(n, a):
    d = defaultdict(set)
    for i in range(1, n + 1):
        d[a[i][0]].add(i)
        d[a[i][1]].add(i)
    start = 1
    for i in range(1, n + 1):
        if len(d[i]) == 1:
            start = i
            break
    res = []
    for i in range(n - 1):
        res.append(start)
        start = a[start][0] if a[start][0] != res[-1] else a[start][1]
    print(' '.join(map(str, res)))

n = int(input())
a = defaultdict(list)
for i in range(n):
    a[i + 1] = list(map(int, input().split()))
print(solve(n, a))

# https://atcoder.jp/contests/abc015/tasks/abc015_4


def main():
    n = int(input())
    w = int(input())
    a = [0] * w
    for i in range(n):
        a[i] = int(input())
    ans = 0
    for i in range(1 << n):
        s = 0
        for j in range(n):
            if (i >> j) & 1:
                s += a[j]
        if s == w:
            ans += 1
    print(ans)


if __name__ == '__main__':
    main()
